形づくり、表面整え、表面磨きの3ステップ+仕上げの保湿オイルで、手軽にナチュラルで輝きのある爪へと導きます。手と足の爪両用です。ヘッド、オイルもセットになっていますので、届き次第すぐにお手入れしていただくことができるキットです。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">形づくり、表面整え、表面磨きの3ステップ+仕上げの保湿オイルで、手軽にナチュラルで輝きのある爪へと導きます。手と足の爪両用です。ヘッド、オイルもセットになっていますので、届き次第すぐにお手入れしていただくことができるキットです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">本体(キャップ含):W75×D44×H165mm</font><br><font color="#333333" size="-1">個装サイズ：17×20×4cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：200g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">【オイル】<br>ヒマワリ種子油、アーモンド油、アマニ油、アンズ核油、アボガド油、パルミチン酸イソプロピル、香料、酢酸トコフェロール、アルガニアスピノサ核油、シア脂油</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">使用電池:単3アルカリ乾電池×1本</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">電動ネイルケアキット本体×1<br>ヘッドキャップ×1<br>ネイルケアヘッド3種×各1<br>単3アルカリ乾電池(テスト電池)×1<br>オイル3.0ml×1</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
